	if tick() - lastTick >= frameInterval then
		fpsUpdateEvent:FireServer(frames[currentFrame])
		currentFrame += 1
		lastTick = tick()

		if currentFrame > #frames then
			currentFrame = 1 -- Reset to the first frame for looping
		end
	end
end)
